import React from "react";
import { Navigate } from "react-router-dom";

function ProtectedRouteElement ({ element: Component, loading, ...props }) {
  if (loading) {
    return <div>Loading...</div>;  // или любой другой элемент/компонент, который вы хотите отобразить во время загрузки
  } else {
    return (
      props.loggedIn ? <Component { ...props} /> : <Navigate to="/sign-in" replace />
    );
  }
}

export default ProtectedRouteElement;
